import React from "react";
import Form from "react-bootstrap/Form";

const Help = () => {
  return (
    <Form>
      <div className="mt-3 ms-3">
        <Form.Check type="checkbox" label="default checkbox" />
      </div>
    </Form>
  );
};

export default Help;
